  toFixedDecimal(args){
    try{
      return parseFloat(args.NUMBER).toFixed(args.POINTS);
    }catch(e){
      return 0;
    }
  }
parseJSON({PATH, JSON_STRING}) {
    try {
      const path = PATH.toString().split('/').map(prop => decodeURIComponent(prop));
      if (path[0] === '') path.splice(0, 1);
      if (path[path.length - 1] === '') path.splice(-1, 1);
      let json;
      try {
        json = JSON.parse(' ' + JSON_STRING);
      } catch (e) {
        return e.message;
      }
      path.forEach(prop => json = json[prop]);
      if (json === null) return 'null';
      else if (json === undefined) return '';
      else if (typeof json === 'object') return JSON.stringify(json);
      else return json.toString();
    } catch (err) {
      return '';
    }
  }
  regexReplace({STRING, REGEX, NEWSTRING}) {
    return STRING.toString().replace(new RegExp(REGEX, 'gi'), NEWSTRING);
  }
  newline() {
      return "\n";
    }
	//NETWORK
  orientation_qw() {
    try {
      return screen.orientation.type;
    } catch(error) {
      return "undefined";
    }
  }

   open_window({USER_URL,WIDTH,HEIGHT,LEFT,TOP}) {
      let params = 'popup=1';
      params += isNaN(WIDTH) ? '' : `,width=${Number(WIDTH) < 100 ? 100 : Number(WIDTH) > window.screen.width ? window.screen.width : Number(WIDTH)}`;
      params += isNaN(HEIGHT) ? '' : `,height=${Number(HEIGHT) < 100 ? 100 : Number(HEIGHT) > window.screen.height ? window.screen.height : Number(HEIGHT)}`;
      params += isNaN(LEFT) ? '' : `,left=${Number(LEFT) < 0 ? 0 : Number(LEFT) > window.screen.width ? window.screen.width : Number(LEFT)}`;
      params += isNaN(TOP) ? '' : `,top=${Number(TOP) < 0 ? 0 : Number(TOP) > window.screen.height ? window.screen.height : Number(TOP)}`;
      //Scratch.openWindow(String(USER_URL), params);
      window.open(String(USER_URL), params);
    }
    redirect_link_block({USER_URL}) {
      //Scratch.redirect(USER_URL);
      document.location.href = USER_URL
    }
  rtt() {
      try {
        return navigator.connection.rtt || '';
      } catch (err) {
        return '';
      }
  }
   downlink_max() {
      try {
        return navigator.connection.downlinkMax || '';
      } catch (err) {
        return '';
      }
    };
   downlink_speed() {
      try {
        return navigator.connection.downlink || '';
      } catch (err) {
        return '';
      }
    }
   network_generation() {
      try {
        switch (navigator.connection.effectiveType) {
          case 'slow-2g': case '2g': return '2g';
          case '3g': return '3g';
          case '4g': return '4g';
          default: return '';
        }
      } catch (err) {
        return '';
      }
    }
   network_type() {
      try {
        switch (navigator.connection.type) {
          case 'bluetooth': return 'bluetooth';
          case 'cellular': return 'cellular';
          case 'ethernet': return 'ethernet';
          case 'wifi': return 'wi-fi';
          case 'wimax': return 'wimax';
          default: return '';
        }
      } catch (err) {
        return '';
      }
    }
  
