Clipboard (args, util){
  const MAXLENGTH = args.MAXLENGTH;
  const NONTEXT = args.NONTEXT;

if (true) {
      if (Boolean(NONTEXT) == true) {
			navigator.clipboard.read()
		} else {
			navigator.clipboard.readText()
		}
        const clipboardcontents = String(navigator.clipboard.read());
        if (length(clipboardcontents) > MAXLENGTH) {
          return("Clipboard length too long");
        } else {
	        return(clipboardcontents);
        }
    } else {
      return("Clipboard permission denied");
    }
}

